export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:h,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:d,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:d,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:d,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:h,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:i,pageSize:25,pageCount:i,total:5}}},kiZDLsDnpq:{data:{id:2149,attributes:{imdbId:"tt1374989",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjE1MzA3NzYxMl5BMl5BanBnXkFtZTgwMzQ0NDA5NzE@._V1_SX300.jpg",type:d,ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"},{Source:"Rotten Tomatoes",Value:"46%"},{Source:"Metacritic",Value:"45\u002F100"}],item_lang:{data:{id:2812,attributes:{title:e,plot:"The five highly trained Bennett sisters in Georgian England must try to protect themselves from the growing zombie threat, find suitable husbands for themselves, battle marriage proposals and unlikely suitors, and save the country before it's too late.",slug:"pride-and-prejudice-and-zombies"}}},books:{data:[{id:10608,attributes:{title:e,description:j,thumbnail:k,authors:[a,b],firstBook:true,published:l,publisher:g,subtitle:c}},{id:10609,attributes:{title:e,description:"'It is a truth universally acknowledged that a zombie in possession of brains must be in want of more brains'. So begins 'Pride and Prejudice and Zombies' - Austens' classic fiendishly mashed-up with scenes of zombie mayhem. This graphic novel adaptation features original art work and brings the tale to a whole new audience.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cJHNQwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Tony Lee",a,"Cliff Richards",b],firstBook:f,published:"2010-01-01",publisher:c,subtitle:"The Graphic Novel"}},{id:10610,attributes:{title:e,description:j,thumbnail:k,authors:[a,b],firstBook:f,published:l,publisher:g,subtitle:c}},{id:10611,attributes:{title:"Pride and Prejudice and Zombies: The Graphic Novel",description:"THE NEW YORK TIMES BESTSELLER—NOW AN EYE-POPPING GRAPHIC NOVEL OF MANNERS, MORALS, AND BRAIN-EATING MAYHEM It is known as “the strange plague,” and its unfortunate victims are referred to only as “unmentionables” or “dreadfuls.” All over England, the dead are rising again, and now even the daughters of Britain’s best families must devote their lives to mastering the deadly arts. Elizabeth Bennet is a fearsome warrior whose ability with a sword is matched only by her quick wit and even sharper tongue. But she faces her most formidable foe yet in the haughty, conceited, and somehow strangely attractive Mr. Darcy. As the two lovers meet in the ballroom and on the battlefield, they’ll soon learn that nothing—not even bands of ninjas, hordes of flesh-eating zombies, or disapproving aunts—can stop true love.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jfW5BAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,b],firstBook:f,published:"2013-04-03",publisher:"Ballantine Group",subtitle:c}},{id:10612,attributes:{title:"Pride and Prejudice and Zombies: The Deluxe Heirloom Edition",description:"The New York Times Best Seller now with 30% more zombies! “It is a truth universally acknowledged that a zombie in possession of brains must be in want of more brains.” So begins Pride and Prejudice and Zombies, an expanded version of the beloved Jane Austen novel featuring all-new scenes of bone-crunching zombie mayhem. This deluxe heirloom edition includes a new preface by coauthor Seth Grahame-Smith, thirteen oil painting illustrations by Roberto Parada, and a fascinating afterword by Dr. Allen Grove of Alfred University. Best of all, this limited special edition features an incredible 30 percent more zombies—via even more all-new scenes of carnage, corpse slaying, and cannibalism. Complete with a satin ribbon marker and a leatherette binding designed to endure for generations, this hardcover volume honors a masterpiece of classic zombie literature.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QuyHAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,b],firstBook:f,published:"2014-01-21",publisher:g,subtitle:c}}]}}},meta:{}}},prerenderedAt:1682568401137}}("Jane Austen","Seth Grahame-Smith","","movie","Pride and Prejudice and Zombies",null,"Quirk Books","series",1,"The New York Times best seller is now a major motion picture starring Lily James and Sam Riley, with Matt Smith, Charles Dance, and Lena Headey. This edition features sixteen pages of color stills from the film, a reading group discussion guide, and other bonus materials. Complete with romance, heartbreak, swordfights, cannibalism, and thousands of rotting corpses, Pride and Prejudice and Zombies is an audacious retelling of English literature’s most enduring novel. This expanded edition of the beloved Jane Austen novel featuring all-new scenes of bone-crunching zombie mayhem begins when a mysterious plague falls upon the quiet English village of Meryton—and the dead are returning to life! Feisty heroine Elizabeth Bennet is determined to wipe out the zombie menace, but she’s soon distracted by the arrival of the haughty and arrogant Mr. Darcy. What ensues is a delightful comedy of manners with plenty of civilized sparring between the two young lovers—and even more violent sparring on the blood-soaked battlefield. It’s the perfect read for literature lovers, zombie fans, and anyone who loves a reanimated Austen.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=x5xPaPeZzmUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2009-05-01"))